import * as actionTypes from "./constants";

import { getTopBanners } from "@/services/recommend";

//
const changeTopBannerAction = () => {};

// 从网络异步获取 Banner 信息
export const getTopBannerAction = () => {
  return (dispatch) => {
    getTopBanners().then((res) => {
      console.log("@", res);
    });
  };
};
